import './index.css';
import React from 'react';
import ReactDOM from 'react-dom/client';

import Calculator from './main/Calculator';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <Calculator />
  </React.StrictMode>
);


